void test_bool() {
#ifdef __cplusplus
  bool x, expr, d, e, v, r;
#else
  _Bool x, expr, d, e, v, r;
#endif

  #pragma omp atomic compare capture
  { v = x; if (x < expr) { x = expr; } } // MAX

  #pragma omp atomic compare capture
  { if (x < expr) { x = expr; } v = x; } // MAX

  #pragma omp atomic compare capture
  if (x == e) { x = d; } else { v = x; }

  #pragma omp atomic compare capture
  { r = x == e; if(r) { x = d; } }

  #pragma omp atomic compare capture
  { r = x == e; if(r) { x = d; } else { v = x; } }
}

